import React from "react";
import Pdf_Viewer from "./pdf-viewer";

function Prestige(){
    const PdfUrl="https://homebrewery.naturalcrit.com/share/4y71vtT721Xi";

    return(
        <Pdf_Viewer pdfUrl={PdfUrl}></Pdf_Viewer>
    )
}

export default Prestige;
